import React from 'react';
import Tabs from "./components/Tabs";
import './App.css';

function App() {
  return (
    <div>
      <h1>Find a Person</h1>
      <Tabs>
        <div label="Gator">
          <></>
        </div>
        <div label="Croc">
          After 'while, <em>Crocodile</em>!
        </div>
        <div label="Sarcosuchus">
          Nothing to see here, this tab is <em>extinct</em>!
        </div>
      </Tabs>
    </div>
  );
}

export default App;
